import React from "react";
import TheImage from "../../assets/meals.jpg";
const Header = () => {
  return (
    <>
      <header class>
        <h1>RectMeals</h1>
        <button>Cart</button>
      </header>
      <div>
        <img src={TheImage} alt="delicious food" />
      </div>
    </>
  );
};

export default Header;
